import Single from "./single";

export function getDisplayElements(ques) {
	const elementLst = [];
	ques.forEach((que, index) => {
		// console.log(index,'---',que);
		switch (que.type) {
			case 'single': {
				elementLst.push(<Single que={que}/>);
				return;
			}
		}
	});
	return elementLst;
}
